    false,nt"url": null,nt"notes": "This annual narrative report for Rachel
    Carson NWR outlines Refuge accomplishments during the 2000 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, grasslands, haying, fire management, and pest control. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, and disease control. The public uses of the Refuge described in this
    report include outdoor classrooms, interpretive programs, hunting, fishing, and
    law enforcement. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment replacement,
    communication systems, computer systems, and energy conservation. Refuge brochures
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
